import React, { useEffect, useState } from 'react';
import { fetchTrajectory, fetchAllAuthors } from '../services/api';

function TrajectoryPage() {
  const [author, setAuthor] = useState('');
  const [data, setData] = useState([]);
  const [authorList, setAuthorList] = useState([]);
  const [suggestions, setSuggestions] = useState([]);

  // 추천 저자 리스트 유지
  const recommendedAuthors = [
    "Rachel Bawden",
    "Benoît Sagot",
    "Maged S. Al-Shaibani",
    "Yassir Fathullah",
    "Jaehoon Kim"
  ];

  useEffect(() => {
    fetchAllAuthors().then(res => {
      setAuthorList(res.data);
    });
  }, []);

  const handleInputChange = (e) => {
    const keyword = e.target.value;
    setAuthor(keyword);

    if (keyword.length < 1) {
      setSuggestions([]);
      return;
    }

    const matched = authorList
      .filter(name => name.toLowerCase().includes(keyword.toLowerCase()))
      .slice(0, 10);
    setSuggestions(matched);
  };

  const handleSuggestionClick = (name) => {
    setAuthor(name);
    setSuggestions([]);
    handleSearch(name);
  };

  const handleRecommendClick = (name) => {
    setAuthor(name);
    setSuggestions([]);
    handleSearch(name);
  };

  const handleSearch = (authorName = author) => {
    if (!authorName) return;
    fetchTrajectory(authorName).then(res => {
      setData(res.data);
    }).catch(err => {
      console.error("API error:", err);
      setData([]);
    });
  };

  const computeStatistics = () => {
    if (data.length === 0) return null;

    const scores = data.map(d => d.pagerank ?? 0);
    const years = data.map(d => d.year);
    const totalScore = scores.reduce((a, b) => a + b, 0);
    const peakScore = Math.max(...scores);
    const peakYear = data.find(d => d.pagerank === peakScore)?.year;
    const deltas = scores.slice(1).map((s, i) => s - scores[i]);
    const maxDelta = deltas.length > 0 ? Math.max(...deltas) : 0;

    return {
      startYear: Math.min(...years),
      endYear: Math.max(...years),
      totalScore,
      peakScore,
      peakYear,
      maxDelta
    };
  };

  const stats = computeStatistics();

  return (
    <div style={{ padding: '20px' }}>
      <h2>Author Trajectory</h2>

      {/* 검색창 */}
      <div style={{ marginBottom: '10px', position: 'relative' }}>
        <input
          value={author}
          onChange={handleInputChange}
          placeholder="Enter author name"
          style={{ marginRight: '10px', padding: '5px', width: '300px' }}
        />
        <button onClick={() => handleSearch()} style={{ padding: '5px 15px' }}>Search</button>

        {suggestions.length > 0 && (
          <ul style={{
            position: 'absolute',
            top: '35px',
            background: '#fff',
            border: '1px solid #ddd',
            padding: '5px',
            margin: 0,
            width: '300px',
            zIndex: 10,
            listStyle: 'none',
            maxHeight: '200px',
            overflowY: 'auto',
            borderRadius: '5px',
            boxShadow: '0 2px 5px rgba(0,0,0,0.15)'
          }}>
            {suggestions.map((name, idx) => (
              <li key={idx} style={{ padding: '5px', cursor: 'pointer' }}
                  onClick={() => handleSuggestionClick(name)}>
                {name}
              </li>
            ))}
          </ul>
        )}
      </div>

      {/* 추천 저자 */}
      <div style={{ marginBottom: '20px' }}>
        <h4>Recommended Authors:</h4>
        {recommendedAuthors.map(name => (
          <button
            key={name}
            onClick={() => handleRecommendClick(name)}
            style={{ marginRight: '10px', marginBottom: '10px', padding: '5px 10px' }}
          >
            {name}
          </button>
        ))}
      </div>

      {data.length === 0 ? (
        <p>No data. Please search an author.</p>
      ) : (
        <div style={{ display: 'flex', gap: '30px' }}>
          <div style={{ flex: 1 }}>
            <h3>Trajectory Data</h3>
            <ul>
              {data.map((item, idx) => (
                <li key={idx}>
                  <strong>{item.year}</strong> - Pagerank: {(item.pagerank ?? 0).toFixed(5)}
                </li>
              ))}
            </ul>
          </div>

          <div style={{
            flex: 1,
            background: '#f9f9f9',
            border: '1px solid #ddd',
            borderRadius: '10px',
            padding: '15px',
            boxShadow: '0 2px 5px rgba(0,0,0,0.1)'
          }}>
            <h3>Trajectory Analysis</h3>
            <p><strong>Active Period:</strong> {stats.startYear} ~ {stats.endYear}</p>
            <p><strong>Peak Pagerank:</strong> {stats.peakScore.toFixed(5)} (in {stats.peakYear})</p>
            <p><strong>Total Pagerank:</strong> {stats.totalScore.toFixed(5)}</p>
            <p><strong>Max Year-to-Year Growth:</strong> {stats.maxDelta.toFixed(5)}</p>
          </div>
        </div>
      )}
    </div>
  );
}

export default TrajectoryPage;
